import { StyleSheet } from '@react-pdf/renderer';

export const styles = StyleSheet.create({
  page: {
    padding: '10mm',
    fontFamily: 'NanumGothic',
    fontSize: 10,
  },
  header: {
    marginBottom: '5mm',
  },
  formNumber: {
    fontSize: 11,
    textAlign: 'right',
  },
  title: {
    fontSize: 16,
    textAlign: 'center',
    marginBottom: '5mm',
    fontWeight: 'bold'
  },
  table: {
    width: '100%',
    border: '1pt solid black',
  },
  row: {
    flexDirection: 'row',
    borderBottom: '1pt solid black',
    minHeight: '8mm',
  },
  cell: {
    flex: 1,
    flexDirection: 'row',
    borderRight: '1pt solid black',
  },
  label: {
    width: '25%',
    padding: '2mm',
    backgroundColor: '#f5f5f5',
    borderRight: '1pt solid black',
  },
  value: {
    flex: 1,
    padding: '2mm',
  },
  photoCell: {
    width: '25mm',
    height: '30mm',
    padding: '1mm',
  },
  photo: {
    width: '100%',
    height: '100%',
    objectFit: 'contain',
  },
  column: {
    flex: 1,
    padding: '2mm',
  }
});
